'use strict';
class MediatorBeforeCallback {
    symbols;
    instrumentUpdatesStorage;
    static create(symbols, instrumentUpdatesStorage) {
        let instance;
        instance = new MediatorBeforeCallback();
        instance.symbols = symbols;
        instance.instrumentUpdatesStorage = instrumentUpdatesStorage;
        return instance;
    }
    invoke() {
        this.instrumentUpdatesStorage.removeSymbols(this.symbols);
    }
}
module.exports = MediatorBeforeCallback
